export const Table = ({data}) => {

    const tableData = data?.map((item)=>{
        return (
            <tr>
            <th>{item.firstName}</th>
            <th>{item.lastName}</th>
            <th>{item.participation}</th>
          </tr>
        )
    })


    return (
        <table>
            {tableData}
        </table>
    )
}
